import "./Video.css"

const Video = (props) => {
    const {titulo,imagen,colorPrimario}=props.datos
    const estiloFondo = {
        backgroundColor: colorPrimario
    }
    return (
        <section className="contenedorVideo" style={estiloFondo}>
            <img className="videoImg" src={imagen} alt={titulo}/>
            <section className="contenedorInteraccionVideo">
                <div className="contenedorIconos">
                    <img src="./img/eliminar.png" alt="Icono de eliminar"></img>
                    ELIMINAR
                </div>
                <div className="contenedorIconos">
                    <img src="./img/editar.png" alt="Icono de editar"></img>
                    EDITAR
                </div>
            </section>
        </section>
    )
}

export default Video;
